import React from 'react'
// Importing Bootstrap
import { Button } from 'reactstrap';


class Search extends React.Component {
  render() {
    return (
      <div>
        <div className="header-title">
          <h1>
            <a href="#">
              GIT COMMANDS
            </a>
          </h1>
        </div>
        <div className="subtitle">
          <p>
            LEARN GIT IN AN INTERACTIVE WAY
          </p>
        </div>
      </div>

    );
  }
}

export default Search;
